import React, { Component, Fragment } from "react";
import "./App.css";
import Header from "./components/Header";
import Voved from "./components/Voved";
import Game from "./components/Game";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Fragment>
        <Header />
        <Voved />
        <Game />
      </Fragment>
    );
  }
}

export default App;
